contracts/agroCadena.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract AgroCadena {

    struct Agricultor {
        address id;
        string nombre;
        string ubicacion;
    }

    struct Producto {
        uint256 id;
        address propietarioActual;
        address agricultorOriginal;
        string nombreProducto;
        string urlImagen;
        string[] historialTransacciones;
    }

    mapping(address => Agricultor) public agricultores;
    mapping(uint256 => Producto) public productos;
    uint256 public contadorProductos;

    event AgricultorRegistrado(address indexed id, string nombre, string ubicacion);
    event ProductoRegistrado(uint256 indexed id, address indexed agricultor, string nombreProducto);
    event ProductoTransferido(uint256 indexed id, address indexed de, address indexed hacia, string descripcion);

    function registrarAgricultor(string memory _nombre, string memory _ubicacion) public {
        require(bytes(agricultores[msg.sender].nombre).length == 0, "Agricultor ya registrado.");

        agricultores[msg.sender] = Agricultor({
            id: msg.sender,
            nombre: _nombre,
            ubicacion: _ubicacion
        });

        emit AgricultorRegistrado(msg.sender, _nombre, _ubicacion);
    }

    function registrarProducto(string memory _nombreProducto, string memory _urlImagen) public {
        require(bytes(agricultores[msg.sender].nombre).length > 0, "Solo agricultores registrados pueden registrar productos.");

        contadorProductos++;

        Producto storage nuevoProducto = productos[contadorProductos];

        nuevoProducto.id = contadorProductos;
        nuevoProducto.propietarioActual = msg.sender;
        nuevoProducto.agricultorOriginal = msg.sender;
        nuevoProducto.nombreProducto = _nombreProducto;
        nuevoProducto.urlImagen = _urlImagen;

        string memory primeraTransaccion = string(abi.encodePacked("Cosechado por ", agricultores[msg.sender].nombre));
        nuevoProducto.historialTransacciones.push(primeraTransaccion);

        emit ProductoRegistrado(contadorProductos, msg.sender, _nombreProducto);
    }

    function transferirProducto(uint256 _idProducto, address _nuevoPropietario, string memory _descripcion) public {
        require(productos[_idProducto].propietarioActual == msg.sender, "No eres el propietario actual del producto.");
        require(_nuevoPropietario != address(0), "Direccion invalida.");

        address propietarioAnterior = productos[_idProducto].propietarioActual;
        productos[_idProducto].propietarioActual = _nuevoPropietario;
        productos[_idProducto].historialTransacciones.push(_descripcion);

        emit ProductoTransferido(_idProducto, propietarioAnterior, _nuevoPropietario, _descripcion);
    }

    function obtenerProducto(uint256 _idProducto) public view returns (
        uint256 id,
        address propietarioActual,
        address agricultorOriginal,
        string memory nombreProducto,
        string memory urlImagen,
        string[] memory historialTransacciones
    ) {
        Producto storage producto = productos[_idProducto];
        return (
            producto.id,
            producto.propietarioActual,
            producto.agricultorOriginal,
            producto.nombreProducto,
            producto.urlImagen,
            producto.historialTransacciones
        );
    }
}

